// react
import React from 'react';

// third-party
import { Link } from 'react-router-dom';

// application
import LogoPanel from './LogoPanel';
import NavPanel from './NavPanel';

function Header() {
    return (
        <div className="ekat-header">
            <div className="ekat-header__logo-panel">
                <LogoPanel />
            </div>
            
            <div className="ekat-header__nav-panel">
                <NavPanel layout={layout} />
            </div>
        </div>
    );
}

Header.propTypes = {
    /** one of ['default', 'mobile'] (default: 'default') */
    layout: PropTypes.oneOf(['default', 'mobile']),
};

Header.defaultProps = {
    layout: 'default',
};

export default Header;
